import React, { useRef, useCallback } from "react";
import { Form } from "@unform/web";

import { Button } from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";

import Input from "../components/input";
import history from "../services/history";

import { Container } from "./styles";

const useStyles = makeStyles((theme) => ({
  root: {
    "& > *": {
      margin: theme.spacing(1),
      width: "28ch",
    },
  },
}));

function Dashboard() {
  const classes = useStyles();
  const formRef = useRef(null);

  const handleSubmitClientId = useCallback((data) => {
    history.push(
      `https://accounts.spotify.com/authorize?client_id=${data.clientId}&redirect_uri=http://localhost:3000&response_type=token&state=123`
    );
  }, []);

  return (
    <Container>
      <Form
        ref={formRef}
        className={classes.root}
        onSubmit={handleSubmitClientId}
      >
        <h2>Ol√°, seja Bem vindo!</h2>

        <Input
          id="outlined-basic"
          label="Insira aqui seu Client ID"
          name="clientId"
          variant="outlined"
        />

        <Button type="submit">Enviar</Button>
      </Form>
    </Container>
  );
}

export default Dashboard;
